'use strict';(function(){var b=location.pathname.split('/'),c=b[b.length-1].replace('.html',''),d=document.querySelector('.header-box header');null!==d&&new Vue({el:'#submenu',data:{results:[],currentPage:'',isActive:!1},created:function created(){d.insertAdjacentHTML('beforeend','<div id="submenu"></div>'),this.getData();},methods:{getData:function getData(){var e=this;fetch('assets/submenu/'+'submenu.json').then(function(f){return f.json();}).then(function(f){e.results=f.filter(function(g){return g.id===c;}),e.isActive=!0;});},setTitle:function setTitle(e){return this.currentPage?e+' / '+this.currentPage:e;}},template:'\n                <div class="page-submenubox" :class="{active:isActive}">\n                    <div class="page-submenu">\n                        <div class="container">\n                            <template v-for="result in results">\n                                <h2>{{setTitle(result.title)}}</h2>\n                                <ul class="page-submenu-list">\n                                    <li v-for="menu in result.menus">\n                                        <span>\n                                            <a :href="menu.url" target="_blank">{{menu.text}}</a>\n                                        </span>\n                                        <ul v-if="menu.dropdowns" class="page-submenu-dropdown">\n                                            <li v-for="dropdown in menu.dropdowns">\n                                                <a :href="dropdown.url" target="_blank"">{{dropdown.text}}</a>\n                                            </li>\n                                        </ul>\n                                    </li>\n                                </ul>\n                            </template>\n                        </div>\n                    </div>\n                </div>\n            '});})();